INSERT INTO `articles` VALUES ('01JGZ26K8CW4GPWYHQ5H9N4ZXN','Real Estate Market Trends in 2025','The real estate market is showing promising signs of growth in 2025, with increased demand for suburban properties and a surge in luxury home sales.','2025-01-06','1.jpg','2025-01-07 00:21:28','2025-01-07 00:21:28'),('01JGZ26KAYH0GE943DB7SVY4AK','Top 5 Cities for Real Estate Investment in 2025','These five cities are expected to be the hottest spots for real estate investment in 2025, offering lucrative opportunities for investors looking for high returns.','2025-01-05','2.jpg','2025-01-07 00:21:28','2025-01-07 00:21:28'),('01JGZ26KD7TMB80FJWKY37BHV9','How to Secure a Mortgage for Your Dream Home','Securing a mortgage can be tricky, but with the right knowledge, you can navigate the process easily. Here are tips to get the best mortgage rates for your new home.','2025-01-04','3.webp','2025-01-07 00:21:28','2025-01-07 00:21:28'),('01JGZ26KFJXV4KMFN8BVMHCFK2','The Future of Smart Homes in Real Estate','Smart homes are revolutionizing the real estate market, with advanced technology providing convenience, security, and energy efficiency for homeowners.','2025-01-03','4.jpg','2025-01-07 00:21:28','2025-01-07 00:21:28'),('01JGZ26KHV32219W80BGPTGNFD','Tips for First-Time Home Buyers in 2025','If you are a first-time homebuyer, these tips will help guide you through the process, from choosing the right property to securing financing.','2025-01-02','5.png','2025-01-07 00:21:28','2025-01-07 00:21:28'),('01JGZ26KM3R9BRN4JQ03J02BNE','Real Estate Trends You Need to Know in 2025','Discover the top real estate trends for 2025, including the shift to remote work driving demand for larger homes and properties in quieter areas.','2025-01-01','6.jpg','2025-01-07 00:21:28','2025-01-07 00:21:28'),('01JGZ26KPF8JXVE53QJYE4NJZX','Why 2025 is the Year to Invest in Real Estate','With interest rates remaining low and demand for properties rising, 2025 is shaping up to be an excellent year to make a real estate investment.','2024-12-31','7.jpg','2025-01-07 00:21:28','2025-01-07 00:21:28'),('01JGZ26KRQ3HMR84PBHJX93TXX','The Impact of Sustainable Design on Real Estate Prices','Sustainable and eco-friendly designs are becoming increasingly popular among homebuyers, leading to higher property values in environmentally conscious areas.','2024-12-30','8.jpg','2025-01-07 00:21:28','2025-01-07 00:21:28'),('01JGZ26KV0TANM53F8TRGB3DXY','Navigating the Real Estate Market Post-Pandemic','As the world recovers from the pandemic, the real estate market is shifting in new directions. Learn how to adjust your investment strategies in this new environment.','2024-12-29','9.jpg','2025-01-07 00:21:29','2025-01-15 08:35:48'),('01JGZ26KX8D7X3DSV8SBTFVA8X','How Virtual Tours are Changing Real Estate Sales','Virtual tours have become a game-changer in real estate sales, allowing potential buyers to explore properties from the comfort of their homes and make informed decisions.','2024-12-28','10.jpg','2025-01-07 00:21:29','2025-01-07 00:21:29'),('01JJ8CBFFDRCX0GCT7DTR8BG75','asd','asd','2025-01-04','01JJ8CBF6994KNPZYJEJSKYY1H.jpg','2025-01-23 01:27:45','2025-01-23 01:27:45');
