INSERT INTO `questions` VALUES ('01JGZ26KZWR7QXYVDN4C2QGRED','What is the process of buying a home?','The process involves several steps, including finding a property, securing financing, making an offer, and closing the deal.','active','2025-01-07 00:21:29','2025-01-09 01:51:41'),('01JGZ26M27Y3HGFKAFMD8TMDQX','How do I know if a property is a good investment?','Research market trends, check the neighborhood’s potential, and consult with a real estate agent or financial advisor to assess the investment.','active','2025-01-07 00:21:29','2025-01-07 00:21:29'),('01JGZ26M4HMXM52YVNYAP6ZSV1','What is the difference between renting and buying a property?','Buying a property involves ownership and equity building, while renting is a temporary arrangement without ownership.','active','2025-01-07 00:21:29','2025-01-07 00:21:29'),('01JGZ26M6XFQRYGYFY06DZXT01','What factors affect property prices?','Location, market demand, property condition, and economic factors like interest rates all affect property prices.','active','2025-01-07 00:21:29','2025-01-07 00:21:29'),('01JGZ26M967QZTWCMW9EFKF8CB','How much down payment is needed to buy a home?','Typically, a 20% down payment is recommended, but it can vary depending on the lender and loan type.','active','2025-01-07 00:21:29','2025-01-07 00:21:29'),('01JGZ26MBK3W1BZP8EK0NF259Z','What should I look for in a property inspection?','Check for structural issues, plumbing, electrical systems, roofing condition, and signs of pest infestation.','active','2025-01-07 00:21:29','2025-01-07 00:21:29'),('01JGZ26MDYWY2Y9FDQAZ39M0GF','How do I calculate the value of a property?','Factors like location, size, age, condition, and recent sales in the area help determine the value of a property.','active','2025-01-07 00:21:29','2025-01-07 00:21:29'),('01JGZ26MGJRGSDWA42XYFHV4M4','What is escrow in a real estate transaction?','Escrow is a neutral third party that holds funds during the transaction until all conditions of the deal are met.','active','2025-01-07 00:21:29','2025-01-07 00:21:29'),('01JGZ26MJW9G5WX5GAMD72F55D','How long does it take to close a property deal?','Typically, closing can take anywhere from 30 to 60 days, depending on the complexity of the transaction.','active','2025-01-07 00:21:29','2025-01-07 00:21:29'),('01JGZ26MN5CHS86TA31JX0ZWWF','What is the difference between a buyer\'s agent and a seller\'s agent?','A buyer\'s agent represents the interests of the buyer, while a seller\'s agent works for the seller to market and sell the property.','active','2025-01-07 00:21:29','2025-01-07 00:21:29'),('01JH1NG4TR258PGFSFDN15N0SR','Question','Answerasd','Status','2025-01-08 00:37:13','2025-01-08 02:32:54'),('01JH1VS09D43TZ3TNA11GR68YE','Lerom Ipsum','Lerom Ipsum','active','2025-01-08 02:26:54','2025-01-08 02:46:21'),('01JH2D6K04RV9JKP5C40DKK5ZB','1234?','00, 1234','active','2025-01-08 07:31:25','2025-01-13 03:55:01');
