INSERT INTO `testimonials` VALUES ('01JH6ZCT6ZC4E2C6DG10S3Y6RJ','01JGZN73V2Y5Y68SZ586PN9Y48','Giolo Evora','Ella’s expertise and guidance made selling my home an effortless experience. Her market insights and strategic approach were key to achieving a great result. I couldn’t have asked for a better agent and would recommend her without hesitation.\"','2025-01-10 02:06:21','2025-01-10 02:06:21'),('01JH72FN8359TPKZHBV6Y0ZAEQ','01JGZN73V2Y5Y68SZ586PN9Y48','Justin Mangubat De Castro','I wanted to take a moment to express my appreciation for the exceptional experience I had. Everything exceeded my expectations, from the smooth process to the outstanding quality.\n\nThe attention to detail and dedication to excellence truly stood out. It’s rare to come across such consistency and commitment to providing the best.\n\nThank you for the wonderful service. I look forward to continuing to enjoy such remarkable experiences in the future.','2025-01-10 03:00:20','2025-01-10 03:00:20'),('01JH7AJ67A1AXNZ7BJMYWWZ85V','01JGZN73V2Y5Y68SZ586PN9Y48','John Doe','I just wanted to take a moment to commend you on the fantastic work you did on your recent project. Your effort truly stands out! The depth of your research and the clear, organized way you presented the information were impressive.\n\nYour ability to tackle complex ideas and break them down into accessible points was especially notable. I also appreciated how you creatively incorporated visuals to enhance your message—this added a lot of value.','2025-01-10 05:21:32','2025-01-10 05:21:32'),('01JH7EYQGVVVXZRP26JP65EDXR','01JGZN73V2Y5Y68SZ586PN9Y48','Anne Garcia','Ma\'am Ella was incredible! She made the entire process of buying our first home stress-free and exciting. Her attention to detail and ability to understand exactly what we were looking for were amazing. We couldn’t recommend her more!','2025-01-10 06:38:17','2025-01-10 06:38:17'),('01JH7F089SSNQJJVGXE4YRWBTQ','01JGZN73V2Y5Y68SZ586PN9Y48','Joseph and Liza Reyes','She went above and beyond to help us sell our property quickly and at a great price. She was always available, patient, and extremely knowledgeable. Her friendly and approachable demeanor made the entire experience smooth and enjoyable.','2025-01-10 06:39:07','2025-01-10 06:39:07'),('01JH7F0V82W2X5AMEXJ8N2YXS4','01JGZN73V2Y5Y68SZ586PN9Y48','Grace Dela Cruz','Ella was such a joy to work with! She explained everything clearly, responded quickly to our questions, and helped us sell our property at the best possible price. We highly recommend her!','2025-01-10 06:39:26','2025-01-10 06:39:26'),('01JH7F1NM0DYFV94307DD07QEY','01JGZN73V2Y5Y68SZ586PN9Y48','Patrick Mendoza','Working with Ella was the best decision we made. She was knowledgeable, patient, and very accommodating. She found us a beautiful property and handled everything flawlessly.','2025-01-10 06:39:53','2025-01-10 06:39:53'),('01JH7F308PQE7XK1685EA2M48H','01JGZN73V2Y5Y68SZ586PN9Y48','Ricardo Gomez','Choosing Ella as our real estate agent was the best decision we made. She was incredibly organized and attentive, ensuring that every detail was addressed. She turned what could have been a stressful experience into an exciting journey.','2025-01-10 06:40:37','2025-01-10 06:40:37'),('01JH7F3RJNC2YQNJ7BN244GCR7','01JGZN73V2Y5Y68SZ586PN9Y48','Celina Alverado','Ella Carmella turned our dream of owning a home into reality. Her expertise and personalized approach made us feel valued and understood. We’ll definitely recommend her to our family and friends!','2025-01-10 06:41:02','2025-01-10 06:41:02'),('01JH7F7T9NEHQE65XQQ59XQRSS','01JGZN73V2Y5Y68SZ586PN9Y48','Kimberly Nineria','Ma\'am Ella was super helpful! Like, ang smooth ng process ng pagbili namin ng bahay kasi she guided us all the way. Very approachable and ang galing mag-explain. We’re so happy with her service!','2025-01-10 06:43:15','2025-01-10 06:43:15'),('01JH7F92HQTEC0R3CV5G8P9Q0C','01JGZN73V2Y5Y68SZ586PN9Y48','Maricel Gonzales','Literal na hassle-free working with Ella! She’s so professional pero super warm pa rin. Alam niya yung ginagawa niya and she helped us find the perfect place for our family. Love her energy!','2025-01-10 06:43:56','2025-01-10 06:43:56'),('01JHF4BFWXSTBAYQ6283QXP15Y','01JGZN73V2Y5Y68SZ586PN9Y48','JUSTIN VALENZUELAS','I just wanted to take a moment to recognize your great work. You consistently show dedication and a positive attitude in everything you do. Your hard work and efforts are truly appreciated, and it’s a pleasure to have you on the team','2025-01-13 06:06:56','2025-01-22 03:04:21');
